const Banner = ({withBorder = false, reverse = false, caseStudy = false}: {
    withBorder?: boolean,
    reverse?: boolean,
    caseStudy?: boolean
}) => {
    const border = "border bg-dark-bg flex flex-row items-center justify-center py-4 z-20"
    const reverseItems = 'items-reverse flex flex-row items-center'
    const isMobile = useMediaQuery('(max-width: 768px)');
    const row = caseStudy ? [...caseStudyLogos, ...caseStudyLogos, ...caseStudyLogos, ...caseStudyLogos, ...caseStudyLogos, ...caseStudyLogos] : [...partners, ...partners, ...partners, ...partners, ...partners, ...partners];
    return (
        <div style={{height: "5vh", width: '98%'}}>


            <div style={{marginLeft: '-45px', marginRight: isMobile ? '-5px' : '-45px',}}>
                <div className=" overflow-hidden">
                    <div
                        id="container"
                        style={{borderRight: 'none'}}
                        className={`${withBorder ? border : 'flex flex-row items-center justify-center py-4 z-20'}`}
                    >
                        {row.map((partner, index) => (
                            <div
                                key={index}
                                className={reverse ? reverseItems : "items flex flex-row items-center"}
                            >
                                {partner}
                            </div>
                        ))}
                    </div>
                </div>
            </div>
        </div>

    );
};

export default Banner;